        fetch("/api/snippets")
        .then(response => response.json())
        .then(json => setData(JSON.stringify(json)))
    }, [dataType])

    return (
      <div className="div">

      <div id="darkened">

              <h1>Code snippets!</h1>


              <h2>-------------------------------------------------</h2>



          </div>

        </div>
    )
}

